import React from 'react';
import './Sidebar.css';
function Sidebar() {
  return (
    <div className="sidebar">
      {/* <h1>Hi I'm a Sidebar Page</h1>; */}
      <img
        className="spotify__logo"
        src="https://getheavy.com/wp-content/uploads/2019/12/spotify2019-830x350.jpg"
        alt="spotifyLogo"
      />
    </div>
  );
}

export default Sidebar;
